import React, { Component } from 'react';
import './Footer.css';

class Footer extends Component {

  render() {
    return (
      <div className="Footer">
       <p>&copy; Vasilya Nizamova</p>
       <p>Photo by Kevin Young on Unsplash | Powered by Teleport</p>
      </div>
    )
  }
}

export default Footer
